class Solution {
  int numEnclaves(List<List<int>> grid) {
    int m = grid.length;
    int n = grid[0].length;
    int landCount = 0;

    for (int i = 0; i < m; i++) {
      int j = 0;
      if (grid[i][j] == 1) replaceBoundary(i, j, m, n, grid);
      j = n - 1;
      if (grid[i][j] == 1) replaceBoundary(i, j, m, n, grid);
    }
    for (int j = 0; j < n; j++) {
      int i = 0;
      if (grid[i][j] == 1) replaceBoundary(i, j, m, n, grid);
      i = m - 1;
      if (grid[i][j] == 1) replaceBoundary(i, j, m, n, grid);
    }

    for (int i = 0; i < m; i++) {
      for (int j = 0; j < n; j++) {
        if (grid[i][j] == 1) {
          landCount++;
        }
      }
    }
    return landCount;
  }

  void replaceBoundary(int i, int j, int m, int n, List<List<int>> grid) {
    if (!(i >= 0 && i < m && j >= 0 && j < n && grid[i][j] == 1)) return;
    grid[i][j] = 0;
    replaceBoundary(i + 1, j, m, n, grid);
    replaceBoundary(i - 1, j, m, n, grid);
    replaceBoundary(i, j + 1, m, n, grid);
    replaceBoundary(i, j - 1, m, n, grid);
  }
}

